import image from "../images/wknd-logo-dk.svg"

export default function Hero(){
    return (
    <div class='container'>
        <h1 class="nb-h1 main-heading">Healthcare plans for more healthy days</h1>
        <p class="nb-paragraph main-content"><p>Humana plans focus on your whole-person health, inside and out.</p></p>
        <div class="image">
         <img src={image}/>
      </div>
    </div>
    )
}
